const Sidebar = () => {
  return (
    <aside class="top-[5%] left-[5%] p-4 fixed">
      <button class="p-4 bg-[#c4d5dd6e] text-2xl rounded-sm" type="submit">
        Добавить запись
      </button>
    </aside>
  );
};

export default Sidebar;
